import React from "react";
import {Route} from "react-router-dom";
import About from "./components/views/about.view";
import Cart from "./components/views/cart.view";
import Collections from "./components/views/collections.view";
import Home from "./components/views/home.view";
import Product from "./components/views/product-dynamic.view";
import Products from "./components/views/products.view";

function App() {
  return (
    <>
      <Route path="/home">
        <Home />
      </Route>
      <Route path="/products">
        <Products />
      </Route>
      <Route path="/product">
        <Product />
      </Route>
      <Route path="/collections">
        <Collections />
      </Route>
      <Route path="/cart">
        <Cart />
      </Route>
      <Route path="/about">
        <About />
      </Route>
    </>
  );
}

export default App;
